import React from "react";
import { TextField } from "@mui/material";

import HorizontalBar from "./HorizontalBar";
import Panel from "./Panel";
import Text from "./Text";

export default function AddFlight({ data }) {
  const styles = {
    container: {
      marginLeft: "1em",
      flex: 3,
    },
    header: {
      display: "flex",
      alignItems: "flex-end",
    },
    headerText: {
      fontSize: 21,
    },
    body: {
      display: "flex",
      flexDirection: "column",
      padding: "2em 4em",
    },
  };

  return (
    <Panel style={styles.container}>
      <div style={styles.header}>
        <Text style={styles.headerText}>Add Flight</Text>
      </div>
      <HorizontalBar height={2} />
      <div style={styles.body}>
        <TextField id="standard-basic" label="Origin" variant="standard" />
        <TextField id="standard-basic" label="Destination" variant="standard" />
        <TextField id="standard-basic" label="Flight No." variant="standard" />
        <TextField
          id="standard-basic"
          label="Aircraft Type"
          variant="standard"
        />
        <TextField
          id="standard-basic"
          label="Pilots Needed"
          variant="standard"
        />
        <TextField id="standard-basic" label="Crew Needed" variant="standard" />
      </div>
    </Panel>
  );
}
